(989, 67, 'faq_items_1_faq_question', 'Can your photo booth fit into an elevator or through doors?'),
(990, 67, '_faq_items_1_faq_question', 'field_5ddaa16450b42'),
(991, 67, 'faq_items_1_faq_answer', 'Yes, our booths will fit in any standard sized elevator or through doors. We have designed it so it can come apart. Therefore we can go up stairs, through single doors and even into elevators.'),
(992, 67, '_faq_items_1_faq_answer', 'field_5ddaa18b50b43');
INSERT INTO `photobooth_wppostmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(993, 67, 'faq_items_2_faq_question', 'How many people can fit in the booth?'),
(994, 67, '_faq_items_2_faq_question', 'field_5ddaa16450b42'),
(995, 67, 'faq_items_2_faq_answer', 'We have fit 6 adult men into the booth. Up to 4 can fit comfortable. 5 or over would need to squeeze.'),
(996, 67, '_faq_items_2_faq_answer', 'field_5ddaa18b50b43'),
(997, 67, 'faq_items_3_faq_question', 'Is there an attendant with the photo booth for the entire time?'),
(998, 67, '_faq_items_3_faq_question', 'field_5ddaa16450b42'),
(999, 67, 'faq_items_3_faq_answer', 'Yes. Our professional and friendly attendants stay with the photo booth to ensure it works properly and help guests with any questions.'),
(1000, 67, '_faq_items_3_faq_answer', 'field_5ddaa18b50b43'),
(1001, 67, 'faq_items_4_faq_question', 'Do you provide props for users?'),
(1002, 67, '_faq_items_4_faq_question', 'field_5ddaa16450b42'),
(1003, 67, 'faq_items_4_faq_answer', 'At your request, we can provide props to make your guests photo booth experience fun and entertaining!'),
(1004, 67, '_faq_items_4_faq_answer', 'field_5ddaa18b50b43'),
(1005, 67, 'faq_items_5_faq_question', 'What kind of picture layouts do you offer?'),
(1006, 67, '_faq_items_5_faq_question', 'field_5ddaa16450b42'),
(1007, 67, 'faq_items_5_faq_answer', 'We can do strips or 4x6 traditional picture layouts. In addition, we can customize your prints with your event information and colors. Our designer will create a logo for your event and send it to you prior to the event for your approval.'),
(1008, 67, '_faq_items_5_faq_answer', 'field_5ddaa18b50b43'),
(1009, 67, 'faq_items_6_faq_question', 'How long is the wait for the pictures?'),
(1010, 67, '_faq_items_6_faq_question', 'field_5ddaa16450b42'),
(1011, 67, 'faq_items_6_faq_answer', 'Once a picture is taken, the prints are typically processed within 10 seconds, allowing your guests to return to your event quickly. This is the fastest in the business. However, our booths are usually a party hit so dont be surprised if a line of users develops!'),
(1012, 67, '_faq_items_6_faq_answer', 'field_5ddaa18b50b43'),
(1013, 67, 'faq_items_7_faq_question', 'Does the package include set-up time?'),
(1014, 67, '_faq_items_7_faq_question', 'field_5ddaa16450b42'),
(1015, 67, 'faq_items_7_faq_answer', 'Our rates are based on the time that booth is fully built. We do not charge set up or tear down fees.'),
(1016, 67, '_faq_items_7_faq_answer', 'field_5ddaa18b50b43'),
(1017, 67, 'faq_items_8_faq_question', 'Are there any hidden charges?'),
(1018, 67, '_faq_items_8_faq_question', 'field_5ddaa16450b42'),
(1019, 67, 'faq_items_8_faq_answer', 'There are no hidden charges  there are additional options and services that we offer at additional cost. These items will be discussed prior to booking and outlined in the contract.'),
(1020, 67, '_faq_items_8_faq_answer', 'field_5ddaa18b50b43'),
(1021, 67, 'faq_items_9_faq_question', 'Will I receive a digital copy of the pictures?'),
(1022, 67, '_faq_items_9_faq_question', 'field_5ddaa16450b42'),
(1023, 67, 'faq_items_9_faq_answer', 'Once your event has taken place, we upload all of the photos to a password protected web gallery that from any internet connection. We also provide you with a CD of all of the pictures taken as well. This is a free service that is included will all of our rentals.'),
(1024, 67, '_faq_items_9_faq_answer', 'field_5ddaa18b50b43'),
