(1106, 49, 'faq_items_5_faq_answer', 'We can do strips or 4x6 traditional picture layouts. In addition, we can customize your prints with your event information and colors. Our designer will create a logo for your event and send it to you prior to the event for your approval.'),
(1107, 49, '_faq_items_5_faq_answer', 'field_5ddaa18b50b43'),
(1108, 49, 'faq_items_6_faq_question', 'How long is the wait for the pictures?'),
(1109, 49, '_faq_items_6_faq_question', 'field_5ddaa16450b42'),
(1110, 49, 'faq_items_6_faq_answer', 'Once a picture is taken, the prints are typically processed within 10 seconds, allowing your guests to return to your event quickly. This is the fastest in the business. However, our booths are usually a party hit so dont be surprised if a line of users develops!'),
(1111, 49, '_faq_items_6_faq_answer', 'field_5ddaa18b50b43'),
(1112, 49, 'faq_items_7_faq_question', 'Does the package include set-up time?'),
(1113, 49, '_faq_items_7_faq_question', 'field_5ddaa16450b42'),
(1114, 49, 'faq_items_7_faq_answer', 'Our rates are based on the time that booth is fully built. We do not charge set up or tear down fees.'),
(1115, 49, '_faq_items_7_faq_answer', 'field_5ddaa18b50b43'),
(1116, 49, 'faq_items_8_faq_question', 'Are there any hidden charges?'),
(1117, 49, '_faq_items_8_faq_question', 'field_5ddaa16450b42'),
(1118, 49, 'faq_items_8_faq_answer', 'There are no hidden charges  there are additional options and services that we offer at additional cost. These items will be discussed prior to booking and outlined in the contract.'),
(1119, 49, '_faq_items_8_faq_answer', 'field_5ddaa18b50b43'),
(1120, 49, 'faq_items_9_faq_question', 'Will I receive a digital copy of the pictures?'),
(1121, 49, '_faq_items_9_faq_question', 'field_5ddaa16450b42'),
(1122, 49, 'faq_items_9_faq_answer', 'Once your event has taken place, we upload all of the photos to a password protected web gallery that from any internet connection. We also provide you with a CD of all of the pictures taken as well. This is a free service that is included will all of our rentals.'),
(1123, 49, '_faq_items_9_faq_answer', 'field_5ddaa18b50b43'),
(1124, 255, 'faq_page_section_title', 'Frequently Ask Question'),
(1125, 255, '_faq_page_section_title', 'field_5ddaa0f150b40'),
(1126, 255, 'faq_items', '10'),
(1127, 255, '_faq_items', 'field_5ddaa14450b41'),
(1128, 255, 'faq_items_0_faq_question', 'How big are your booths?'),
(1129, 255, '_faq_items_0_faq_question', 'field_5ddaa16450b42'),
(1130, 255, 'faq_items_0_faq_answer', '74 tall X 48 long X 29 deep. It is a real traditional photo booth that use to be setup in a mall.'),
(1131, 255, '_faq_items_0_faq_answer', 'field_5ddaa18b50b43'),
(1132, 255, 'faq_items_1_faq_question', 'Can your photo booth fit into an elevator or through doors?'),
(1133, 255, '_faq_items_1_faq_question', 'field_5ddaa16450b42'),
(1134, 255, 'faq_items_1_faq_answer', 'Yes, our booths will fit in any standard sized elevator or through doors. We have designed it so it can come apart. Therefore we can go up stairs, through single doors and even into elevators.'),
(1135, 255, '_faq_items_1_faq_answer', 'field_5ddaa18b50b43'),
(1136, 255, 'faq_items_2_faq_question', 'How many people can fit in the booth?'),
(1137, 255, '_faq_items_2_faq_question', 'field_5ddaa16450b42'),
(1138, 255, 'faq_items_2_faq_answer', 'We have fit 6 adult men into the booth. Up to 4 can fit comfortable. 5 or over would need to squeeze.'),
(1139, 255, '_faq_items_2_faq_answer', 'field_5ddaa18b50b43'),
(1140, 255, 'faq_items_3_faq_question', 'Is there an attendant with the photo booth for the entire time?'),
(1141, 255, '_faq_items_3_faq_question', 'field_5ddaa16450b42'),
(1142, 255, 'faq_items_3_faq_answer', 'Yes. Our professional and friendly attendants stay with the photo booth to ensure it works properly and help guests with any questions.'),
(1143, 255, '_faq_items_3_faq_answer', 'field_5ddaa18b50b43'),
(1144, 255, 'faq_items_4_faq_question', 'Do you provide props for users?'),
(1145, 255, '_faq_items_4_faq_question', 'field_5ddaa16450b42'),
(1146, 255, 'faq_items_4_faq_answer', 'At your request, we can provide props to make your guests photo booth experience fun and entertaining!'),
(1147, 255, '_faq_items_4_faq_answer', 'field_5ddaa18b50b43'),
