(1918, 346, 'photo_booth_style_content', '<h3>The largest ALL-steel photo booth in the world can fit 8-12 people!</h3>\r\n<ul class=\"content-list\">\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Can fit up to 12 people in one photo.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> The largest ALL-steel photo booth in the world!</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Instantly Bench style seating for 8-12 people to take a photo with comfort.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Double copies of strips printed in seven seconds.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Instantly request more copies. \"Everyone in the photo will get a strip.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Record live video messages</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Custom Logo on photo strips</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Giant 19\" touch screen inside shows you what you look like while taking a photo.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Giant 19\" screen outside for display of photos.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Traditional elegant design will look great at weddings and all special events.</li>\r\n</ul>'),
