(1937, 359, 'photo_booth_style_content', '<h3>InstaPic Station</h3>\r\n<ul class=\"content-list\">\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> InstaPic Station that can be set up anywhere. Stairs, elevators, and single doors are no problem.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> No seat! Guests will take photos while standing.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Attendant takes photo by a push of a button.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> 4x6 photos printed in seven seconds.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Click then print. 300-400 prints in one hour.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Custom Logo on photos.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Giant screen shows you what you look like while taking a photo.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Instagram inspired look is great at weddings and all special events.</li>\r\n</ul>'),
