(1979, 366, 'photo_booth_style_content', '<h3>Stand-Up design accommodates large groups; guests take photos standing up.</h3>\r\n<ul class=\"content-list\">\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Can fit up to 8 people in one photo.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Stand-Up Styled Photo Booth that can be set up anywhere. Stairs, elevators, and single doors are no problem.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> No seat! Guests will take photos while standing.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Double copies of strips printed in seven seconds.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Instantly request more copies. \"Everyone in the photo will get a strip.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Record live video messages</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Custom Logo on photo strips</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Giant 19\" touch screen inside shows you what you look like while taking a photo.</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Elegant, ALL-steel design will look great at weddings and all special events.</li>\r\n</ul>'),
