(2662, 416, 'photo_booth_rental_content', '<h3>Wedding Photo Booth</h3>\r\nWe are engaged in providing great photo booth rentals for weddings occasions consisting of natural, romantic, and high quality script of photos of you and your guests. The booths are adjustable for every corner i.e. it may be a staircase or an elevator, you dont have to worry about disturbing your arrangement. The photos can be customized as per your needs, as we also provide decorative acrylic frames and photo albums, to enable you preserve your precious memories forever.\r\n\r\n&nbsp;\r\n\r\nWe are ISH Events; provide the best combination of elegance and affordability by offering the best services for wedding photo booth rentals. With high pixels and best technology use, the photo strips produced give attractive and stunning results. The addition of standard effects such as sepia effect, black n white, glow, love-struck, and other added effects such as backdrops having the themes of clouds, earthrise, sunset etc. enhance the photos to a great extent. We have an array of options to choose from for your favorite effects which help you add the right expression to your photos.\r\n\r\n&nbsp;\r\n\r\nEven though we specialize in creating preeminent wedding photo booth rentals, we also provide them for anniversaries, official events, reunions, and all other social events.\r\n\r\n&nbsp;\r\n\r\nTo reserve photo booth for a wedding and grab your most precious moments contact us at sales@ishphotoboothrentals.com\r\n<h3>Add A Dash Of Whimsy With A Wedding Photo Booth</h3>\r\nWhere wedding bells ring, photos are snapped and cheers are made just so happens to be the same place and time your family and friends will revisit time and again when they talk about your wedding. Your wedding is a time for celebration, a time for joy and a time for uniting two families. Your reception is typically where new friends meet old over food and drink. It is during this time that some of the greatest photos you and your spouse will own are taken. Hiring a photographer is almost a given for a wedding, but having a wedding photo booth is a relatively new idea that allows for a different nature of memories to be taken all together.\r\n<h3>Which Photo Booth Is Right For Your Wedding?</h3>\r\nOur selection of wedding photo booth rentals is increasing almost daily because photo booths for weddings are in such high demand. While professional wedding photos, both candid and posed, are wonderful for photo albums and frames, a wedding photo booth allows for your guests to cut loose and make some memories of their own. All our photo booth rentals and kiosks offer printed photos for your guests to have in seconds.\r\n<h3>Our Photo Booth Inventory</h3>\r\n<ul class=\"content-list\">\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Stand Up Style Booth</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Elite Style Booth</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Slow Motion Photo Booth</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Green Screen Station</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> InstaPic Station</li>\r\n</ul>\r\n<h3>Prints Are A Great Way To Share The Fun</h3>\r\nThese retro style photos are great for sharing at the reception, on social media and at home for years to come. Weve also seen our photo booths be a huge hit with younger children. Children can be shy around a photographer but not around our photo booths. Kids love to crowd into frame and make goofy facesa great way for kids to hang out with their cousins and new friends!\r\n\r\n&nbsp;\r\n\r\nIf youre planning a wedding in New York, Manhattan NY, Long Island, Westchester or New Jersey and are thinking a photo booth would be a hit at your wedding, youve come to the right place. Our inventory is sure to meet and exceed your expectations.\r\n<h3>Contact Us Today</h3>\r\nContact us at (888) 340-9190 to learn more about our photo booths or a complete list of kiosks. We can help you throw an unforgettable party or event. Reserve your photo booth today!'),
