(2681, 420, 'default_template_content', '<div class=\"title\">\r\n<h2>Review</h2>\r\n</div>\r\n<ul class=\"content-list\">\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Laura</p>\r\n\"Thank you for making our wedding so much fun with the photo booth. We look at the book ALL the time. Just got a chance to look through the DVD of all the photos and wow are they hilarious! Everyone loved the booth and I will certainly be recommending you to others.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Pedro</p>\r\n\"I wanted to thank Ish events for the wonderful job they did at our wedding. The photo / video booth was a hit! Everyone love it! The staff was friendly and our scrapbook looks amazing. Thanks again!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Bob</p>\r\n\"The greatest thing at our NBC holiday party. Everyone loved it and the drunk videos people left are priceless.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Amanda</p>\r\n\"I am so happy to have rented the photo booth for our big day! My husband and I decided to have our wedding in Manhattan and had friends and family flying in from all over! We were able to have our guests (some of which we didn\'t have too much time to see during the night) leave us videos and photos. The quality of the photos and videos is fantastic (and dare I say rivaled the photographer we hired) The VideoGuest Book beautifully captured the night\'s events and each of our guests walked away with a photo from the night (wedding favors- check!). I highly recommend contacting them for your big day www.ishvideoguestbookcom\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Ellie</p>\r\n\"In my experience, planning a wedding can be a hectic time to say the least. I wanted to make a unique statement that set my wedding reception apart from others taking place in the coming months. I booked a Photo Booth Rental from Ish Events and could not have been happier doing so! They were accommodating and provided exceptional service. Our guests had so much fun taking lots of pictures leaving one copy behind for our album and the other was taken home as a wedding favor. Each strip of photos had a customized logo we designed for our day! I was so impressed and would recommend the Photo Booth Rental though Ish Events for anyone wanting to work with a company who provides an outstanding service!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Becky</p>\r\n\"I was at a recent birthday party and had a chance to use the Photo Booth Rental. My friends and I had such a good time taking photos and leaving the birthday girl video messages! I was able to email myself the photos right from the booth and tag and upload to facebook! I\'ve already booked the booth for my birthday in 4 months!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Stacy</p>\r\n\"What a great Photo booth rental. It was so much fun. We could not stop taking photos and the drunk videos were priceless. I would recommened this Photo Booth Rental to everyone.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Kirstin</p>\r\n\"I could not be happier with the over all service of the Video Guestbook! I booked it for my wedding this past Spring. All the months of wedding planning and the day went by so fast, it is great to be able to look back and see everyone\'s candid videos. This created such a great keepsake!!! I was able to share a link with my friends who were unable to make it and share the celebration with them too. The videos were of beautiful quality and the guest photos were great (we had the option of a scrapbook. A definite must on any bride\'s to do list!)\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Amanda</p>\r\n\"I am beyond happy that I booked Photo Booth Rental for my wedding last month! Courteous and efficient customer service, great price and most of all my friends and family had a blast! I even got to cross the wedding favors off my checklist because everyone had fun taking photos and got to walk away with a memory of the night. ! A must for your next event!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Laura</p>\r\n\"I rented the ISH events photo booth for my October 1st wedding. Let me just say this. Ismael was probably the easiest vendor I worked with. He literally answered any email I sent him in no later than 20 minutes... He wanted to make sure we were truely taken care of and happy with his services and that is what a true business man is all about. Everyone had a BLAST with the photo booth and our scrapbook is absolutely hilarious and also very special. It will be a memory piece forever. We also have a DVD of all the photos taken during the night which is also very fun to look at. We had envelopes made as our favors that were crafted by Ismael and his company. Each person got a photo frame envelope to put their photos in and remember our wedding night. You cannot go wrong with ISH Events photo booth for any event especially your wedding. They were a pleasure to work with. Thank you Ismael!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Lisa</p>\r\n\"Rachelle and I wanted to thank you so much for your participation at the event on Sunday. The photobooth was amazing and we had a lot of compliments from the guests. The organizers have sent out your contact details to all of their members, so we hope that this will be a successful event for you also. Thanks again.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Shan</p>\r\n\"The photo booth was such a hit. We loved it and would definitely recommend you to all our friends.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Cynthia</p>\r\n\"I just wanted to send a thank you to Ismael and Avery for a wonderful night. I had my 30th birthday party on Saturday night and you guys were amazing! My friends and I had a wonderful time using the photo booth!!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Stephanie</p>\r\n\"Hi Ismael. Thank you for everything - the photo booth was fantastic!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Krista</p>\r\n(Before Wedding) \"That is WONDERFUL Ish! Thank you very, very, very much for being so accommodating (esp last minute!). You have EXCELLENT customer service :) And I do mention you as much as I can!! You are the one vendor that it has truly been a pleasure and I thank you so much for that.\" (After Wedding) \"thank you SOOOOOOOOOOOOOOO much for everything Ish!!! Everyone loved you (and your team! Really!) AND Frank and I LOVE the scrapbook!!!!! We spent our wedding night looking thru it til 5am. You truly helped make our night amazing. I wish you nothing but success and will keep those recommendations coming!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Michael</p>\r\n\"thanks very much--we had a great time\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Doreen</p>\r\n(After Wedding) \"Thanks for Ish! We received a million compliments on the photobooth and the quality of the photos. Thanks again for everything. The photobooth was a hit and the photobooth is wonderfully scandalous! Thank you again for your services. We received the DVD last Friday and could not believe some of the pictures that were taken! You have a great business model with great products and services that gave us what we did not even know we wanted with a photobooth. The quality is excellent and we wanted to say a special thank you for providing us great memories. We will definitely recommend you to our friends. Thanks again.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Liz</p>\r\n\"Thanks so much. It was so great having the photo booth at the reception this past Saturday! The guests and I enjoyed having it there.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> An Ting</p>\r\n\"Thank you for everything Ishmael. It was great working with you.\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Jennifer</p>\r\n\"you guys were great! one of the best decisions we made for the wedding!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Ostine</p>\r\n\"Thank you so much! Everyone loved the photobooth and the book Looks great! Was a Lot of fun!\"</li>\r\n 	<li>\r\n<p class=\"title\"><i class=\"fa fa-hand-o-right\"></i> Mandy</p>\r\n\"you guys were awesome! thanks again for everything.\"</li>\r\n</ul>'),
