(2696, 422, 'photo_booth_rental_content', '<h3>The Answer To A Boring Corporate Event Or Party</h3>\r\nWhats a corporate event without a photo booth? A forgotten one, thats what! It only took a few boring fundraising and corporate events with amateur photographers and cheap gifts bags and baskets for us to realize what the events needed. Photos are great for the business and great for those who take the time to go online to download them, but do very little for the guests during the party or event itself.\r\n\r\nPhoto booth rentals are the cost effective way to make your party more interesting, memorable and affordable. Whether youre in New York, Manhattan NY, Long Island, Westchester or New Jersey, its easy to rent photo booths and have them at your next event at a price you and your business can afford.\r\n<h3>Get Your Guests Out Of Their Seats and Mingling</h3>\r\nIts easy to get bored at a corporate event. The attraction shouldnt be the food or the open bar, even though sometimes they are. The point of a corporate event is, hopefully, for team members and employees from other divisions and branches to network. If the mood isnt right at an event, networking outside of your assigned seating can seem impossible. Having activities such as a silent auction, fun games and photo booth rentals help to get your guests out of their chairs for something other than food or a refill.\r\n<h3>Choose The Perfect Photo Booth For Your Party</h3>\r\n<ul class=\"content-list\">\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Stand Up Style</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> InstaPic Station</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Traditional Style</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Green Screen Station</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Elite Style</li>\r\n 	<li><i class=\"fa fa-hand-o-right\"></i> Slow Motion Photo Station</li>\r\n</ul>\r\nIf youre looking to rent photo booths for your next event in NY or the greater NY area, youve come to the right place. Our selection of booths and kiosks is sure to provide what you and your guests will be looking for. We pride ourselves on having some of the most fun and unique photo booths and kiosks, so were confident your guests will interact with a photo booth they havent seen before.\r\n<h3>Contact Us Today</h3>\r\nContact us at <a href=\"tel:8883409190\">(888) 340-9190</a> to learn more about our photo booths or a complete list of kiosks. We can help you throw an unforgettable party or event. Reserve your photo booth today!'),
