(345, 1, '2019-11-25 12:46:21', '2019-11-25 12:46:21', '<div class=\"col-md-6\">\r\n            [text* fullname class:form-control placeholder \"Full Name\"]\r\n          </div>\r\n          \r\n          <div class=\"col-md-6\">\r\n            [number telephonenumber class:form-control placeholder \"Telephone\"]\r\n          </div>\r\n<div class=\"clear\"></div>\r\n          <div class=\"col-md-6\">\r\n            [email* emailAddress class:form-control placeholder \"Email\"]\r\n          </div>\r\n          <div class=\"col-md-6\">\r\n            [select select-your-event class:form-control \"Select your event\" \"Wedding\" \"Birthday\" \"Sweet 16\" \"Corporate\" \"Special Occasions\" \"Others\"]\r\n          </div>\r\n          \r\n          <div class=\"clear\"></div>\r\n          <div class=\"col-sm-12\">\r\n            [select select-your-event class:form-control \"How many hours would you like the photo booth?\" \"2 hours\" \"4 hours\" \"6 hours\" \"8 hours or more\"]\r\n          </div>\r\n          <div class=\"col-sm-12\">\r\n            <p> What Type of booths are you interested in?</p>\r\n            [checkbox what-type-interested class:list-check class:list-2 use_label_element \"Open Vertical Photo Station\" \"Stand up Photo Booth\" \"Traditional Style Photo Booth\" \"Elite Photo Booth\" \"Snap Chat Filter Station\" \"Mirror Photo Stations\" \"Insta Pic Station\" \"Social Photographer\" \"Social Photographer & Prints\"]\r\n            <div class=\"clear\">&nbsp;</div>\r\n          </div>\r\n          \r\n          <div class=\"col-sm-12\">\r\n            <p>We also offer other entertainment, please select from below for pricing?</p>\r\n            [checkbox entertainment class:list-check use_label_element \"Pop a shot\" \"Foosball\" \"Air Hockey\" \"Mega Jenga\" \"Giant Jenga\" \"Giant Connect\" \"Classic Arcade\" \"Family Feud\"]\r\n          </div>\r\n          <div class=\"clear\"></div>\r\n          <div class=\"col-sm-12\">\r\n            <p>We are a huge provider of Casino Parties. <a href=\"http://www.CasinoPartiesLLC.com\" target=\"_blank\" rel=\"noopener noreferrer\">www.CasinoPartiesLLC.com.</a>  are you interested in is including a casino?\r\n          </p>\r\n          [radio Casino-Parties class:list-check use_label_element default:1 \"Yes\" \"No\"]\r\n        </div>\r\n        <div class=\"clear\"></div>\r\n        <div class=\"clear\"></div>\r\n        <div class=\"col-md-12\">\r\n[select* selectedState class:form-control \"Select State\"\r\n \"Alabama|AL\" \"Alaska|AK\" \"Arizona|AZ\" \"Arkansas|AR\"\r\n \"California|CA\" \"Colorado|CO\" \"Connecticut|CT\" \"Delaware|DE\"\r\n \"Washington DC|DC\" \"Florida|FL\" \"Georgia|GA\" \"Hawaii|HI\"\r\n \"Idaho|ID\" \"Illinois|IL\" \"Indiana|IN\" \"Iowa|IA\" \"Kansas|KS\"\r\n \"Kentucky|KY\" \"Louisiana|LA\" \"Maine|ME\"  \"Maryland|MD\"\r\n \"Massachusetts|MA\" \"Michigan|MI\" \"Minnesota|MN\" \"Mississippi|MS\"\r\n \"Missouri|MO\" \"Montana|MT\" \"Nebraska|NE\" \"Nevada|NV\"\r\n \"New Hampshire|NH\" \"New Jersey|NJ\" \"New Mexico|NM\" \"New York|NY\"\r\n \"North Carolina|NC\" \"North Dakota|ND\" \"Ohio|OH\" \"Oklahoma|OK\"\r\n \"Oregon|OR\" \"Pennslyvania|PA\" \"Rhode Island|RI\"\r\n \"South Carolina|SC\" \"South Dakota|SD\" \"Tennessee|TN\"\r\n \"Texas|TX\" \"Utah|UT\" \"Vermont|VT\" \"Virginia|VA\" \"Washington|WA\"\r\n \"West Virginia|WV\" \"Wisconsin|WI\" \"Wyoming|WY\"]\r\n        </div>\r\n        <div class=\"col-md-12\">\r\n          [text* selectDate class:date-input-css class:form-control placeholder \"MM-DD-YYYY\"]\r\n        </div>\r\n        \r\n        <div class=\"col-md-6\">\r\n          [number* zipCode class:form-control placeholder \"Zip Code\"]\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          [text* city class:form-control placeholder \"City\"]\r\n        </div>\r\n        <div class=\"col-md-12\">\r\n          [text* address class:form-control placeholder \"Address\"]\r\n        </div>\r\n        <div class=\"col-md-1