(350, 1, '2019-11-25 15:18:40', '2019-11-25 15:18:40', '<!-- wp:html -->\n<pre class=\"wp-block-preformatted\"> <img class=\"wp-image-349\" style=\"width: 150px;\" src=\"http://localhost/works/2019/11-nov/ish-photoboth-project/photoboth-wp/wp-content/uploads/2019/11/Booth-Style-Elite.png\" alt=\"Booth style elite\" class=\"inner-right-img img-thumbnail\"><h3>The largest ALL-steel photo booth in the world can fit 8-12 people!</h3>\n    <ul class=\"content-list\">\n      <li><i class=\"fa fa-hand-o-right\"> Can fit up to 12 people in one photo.</li>\n      <li><i class=\"fa fa-hand-o-right\"> The largest ALL-steel photo booth in the world!</li>\n      <li><i class=\"fa fa-hand-o-right\"> Instantly Bench style seating for 8-12 people to take a photo with comfort.</li>\n      <li><i class=\"fa fa-hand-o-right\"> Double copies of strips printed in seven seconds.</li>\n      <li><i class=\"fa fa-hand-o-right\"> Instantly request more copies. \"Everyone in the photo will get a strip.</li>\n      <li><i class=\"fa fa-hand-o-right\"> Record live video messages</li>\n      <li><i class=\"fa fa-hand-o-right\"> Custom Logo on photo strips</li>\n      <li><i class=\"fa fa-hand-o-right\"> Giant 19\" touch screen inside shows you what you look like while taking a photo.</li>\n      <li><i class=\"fa fa-hand-o-right\"> Giant 19\" screen outside for display of photos.</li>\n      <li><i class=\"fa fa-hand-o-right\"> Traditional elegant design will look great at weddings and all special events.</li>\n    </ul></pre>\n<!-- /wp:html -->', 'Untitled Reusable Block', '', 'publish', 'closed', 'closed', '', 'untitled-reusable-block', '', '', '2019-11-25 15:18:40', '2019-11-25 15:18:40', '', 0, 'http://localhost/works/2019/11-nov/ish-photoboth-project/photoboth-wp/2019/11/25/untitled-reusable-block/', 0, 'wp_block', '', 0),
